import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

import NavBar from "./components/layout/NavBar";
import './App.css';

class App extends Component {
  render() {
    return <div className="App">
      <NavBar></NavBar>
    </div>
  }
}

export default App;
